      #carbonads {
        display: block;

        display: block;

        line-height: 1;
      }

      .carbon-img img {
        display: block;
        margin: 0 auto;
        max-width: 150px !important;
        width: 150px;
        height: auto;
      }

      .carbon-text {
        display: block;
        padding: 0 1em 8px;
      }

      .carbon-poweredby {
        display: block;
        padding: 8px 12px;
        background: repeating-linear-gradient(
            -45deg,
            transparent,
            transparent 5px,
            hsla(0, 0%, 0%, 0.025) 5px,
            hsla(0, 0%, 0%, 0.025) 10px
          )
          hsla(203, 11%, 95%, 0.4);
        text-transform: uppercase;
        letter-spacing: 0.5px;
        font-weight: 600;
        font-size: 9px;
        line-height: 1;
      }

      html {
        font-variant-ligatures: no-common-ligatures;
      }
